import express from "express";
import { Router } from "express";
const app = express();
var jwt = require("jsonwebtoken");
const { llave } = require("./../config/config");
//Middlewares
app.use(express.json());
//const { isAuth } = require ('./../middlewares/authRoutes.middleware');

const isAuth = Router();
isAuth.use((req, res, next) => {
	const tokenReq = req.headers.authorization;

	if (tokenReq) {
		var tokenArray = tokenReq.split(" ");
		var token = tokenArray[1];
		console.log("HERE IS TOKEN O YES:", token);
		jwt.verify(token, llave, (err, decoded) => {
			if (err) {
				return res.json({ mensaje: "Token inválida" });
			} else {
				req.decoded = decoded;
				next();
			}
		});
	} else {
		res.send({
			mensaje: "Token no proveída.",
		});
	}
});



//Import Routes
import IndexRoutes from "../routes/index.routes";
import TaskRouter from "../routes/tasks.routes";
import UserRouter from "../routes/users.routes";
//Settings
app.set("port", process.env.PORT || 3000);

//Routes
app.use(IndexRoutes);
app.use("/api/tasks", TaskRouter);
app.use("/api/users", UserRouter);
app.get("/get", isAuth, function (req, res) {
	res.send("YES");
});

export default app;

