import { Router } from 'express';
const router = Router();

import bytcryp from 'bcrypt-nodejs';

import { connect } from '../server/database';
import { ObjectID } from 'mongodb';
const  { llave } = require('./../config/config'); 
var jwt = require('jsonwebtoken');

//GET ALL USERS
router.get('/',async (req,res)=>{
    const db = await connect();

    const result = await db.collection('users').find({}).toArray();

    console.log(result)
    res.json(result);


})
//REGISTER-CREATE USER
router.post('/login',async (req,res)=>{
    const db = await connect();
    console.log(req.body);

    const user = {
        email: req.body.email,
        password: req.body.password, 
    }
    const userDB = await db.collection('users').findOne({email:user.email});

    if(!userDB){
        res.send('Usuario no existe');
   }else{
    if(bytcryp.compareSync(user.password, userDB.password)){
        //LOGIN
       const token = createToken(userDB._id);



        res.send(token)
        console.log(token)
    }else{
        //ERROR
        res.send('Error password Wrong');
    }
    }

});


//REGISTER-CREATE USER
router.post('/register',async (req,res)=>{
    const db = await connect();
    console.log(req.body);

    const user = {
        email: req.body.email,
        password:  bytcryp.hashSync(req.body.password),
        name: req.body.name

    }
    const result = await db.collection('users').insert(user);
    res.json(result.ops[0]);
    res.send('user created');   
});

//GET USER BY ID
router.get('/:id',async (req,res)=>{
    const { id } = req.params;
    const db = await connect();
    const result = await db.collection('users').findOne({ _id: ObjectID(id) });

    res.json(result);
})

//DELETE USER 
router.delete('/:id', async(req, res ) => {
    const { id } = req.params;
    const db = await connect();
    await db.collection('users').deleteOne( {_id: ObjectID(id)} );
    res.json({
        message: `user ${id} deleted`,
    })
})

//UPDATE USER
router.put('/:id', async (req, res) =>{
    const { id } = req.params;
    const user = {
        email: req.body.email,
        password: req.body.password,
        name: req.body.name
    };
    const db = await connect();
    const result = await db.collection('users').updateOne({_id : ObjectID( id )},{$set:user});
    res.json({
        result:`${result}`,
        message: `user ${id} update`,
    })
})

 function  createToken (payload){
    var token =  jwt.sign({payload}, llave,{
        expiresIn: 1440
    });


    return token;
}


export default router;

