app.use(bodyParser.urlencoded({ extended: true }));
app.use(bodyParser.json());

//Funcion Main
async function main() {
	await app.listen(port);
	console.log("Server on Port:", port);
	console.log(`Enter Server Test here: http://localhost:${port}/`);
}

main();

