import { Router } from "express";
const router = Router();

import { connect } from "../server/database";
import { ObjectID } from "mongodb";

//-------- CREATE forumCreatePadre  -----
router.post("/", async (req, res) => {
	try {
		const db = await connect();
		console.log(req.body);
		var forumCreate = {};
		//--------------COMPROBAMOS QUE FORUM ES -------------------
		if (!req.body.identificator) {
			forumCreate = {
				author: req.body.author,
				by_role: req.body.by_role,
				title: req.body.title,
				message: req.body.message,
				date: new Date(),
				num_answers: 0,
				identificator: null,
				date_last_answer: new Date(),
			};
		} else {
			forumCreate = {
				author: req.body.author,
				by_role: req.body.by_role,
				title: req.body.title,
				message: req.body.message,
				date: new Date(),
				num_answers: 0,
				identificator: req.body.identificator,
				date_last_answer: new Date(),
			};
		}

		console.log("DATE:", forumCreate.date);
		const result = await db.collection("forums").insert(forumCreate);
		res.json(result.ops[0]);
		res.send("forums created");
	} catch (err) {
		console.log(err);
	}
});

//-----  Actualizar PUBLICACION ---- NumAnswer- LastDate ---
router.put("/:id", async (req, res) => {
	try {
		const { id } = req.params;
		const forumUpdate = {
			num_answers: req.body.num_answers,
			date_last_answer: new Date(),
		};
		const db = await connect();
		await db.collection("forums").updateOne({ _id: ObjectID(id) }, { $set: forumUpdate });
		const result = await db.collection("forums").findOne({ _id: ObjectID(id) });

		res.json({result});
	} catch (err) {
		console.log(err);
	}
});


//-----  EDITAR PUBLICACION -------
router.put("/edit/:id", async (req, res) => {
	try {
		const { id } = req.params;
		const forumEdit = {
			title: req.body.title,
			message: req.body.message,
		};
		const db = await connect();
		await db.collection("forums").updateOne({ _id: ObjectID(id) }, { $set: forumEdit });
		const result = await db.collection("forums").findOne({ _id: ObjectID(id) });

		res.json({result});
	} catch (err) {
		console.log(err);
	}
});

//---------GETTERS---------------
router.get("/", async (req, res) => {
	try {
		const db = await connect();

		const result = await db.collection("forums").find({}).toArray();

		console.log(result);
		res.json(result);
	} catch (err) {
		console.log(err);
	}
});

router.get("/:id", async (req, res) => {
	try {
		const { id } = req.params;
		const db = await connect();
		const result = await db.collection("forums").findOne({ _id: ObjectID(id) });

		res.json(result);
	} catch (err) {
		console.log(err);
	}
});
//-----  UPDATE -------
router.put("/update/:id", async (req, res) => {
	try {
		const { id } = req.params;
		const forum = {
				author: req.body.author,
				by_role: req.body.by_role,
				title: req.body.title,
				message: req.body.message,
				date: req.body.date,
				num_answers: req.body.num_answers,
				identificator: req.body.identificator,
				date_last_answer: req.body.date_last_answer,
		};
		const db = await connect();
		await db.collection("forums").updateOne({ _id: ObjectID(id) }, { $set: forum });
		const result = await db.collection("forums").findOne({ _id: ObjectID(id) });

		res.json({result});
	} catch (err) {
		console.log(err);
	}
});
//-----------DELETE-------------------------
router.delete("/:id", async (req, res) => {
	try {
		const { id } = req.params;
		const db = await connect();
		await db.collection("forums").deleteOne({ _id: ObjectID(id) });
		res.json({
			message: `forums ${id} deleted`,
		});
	} catch (err) {
		console.log(err);
	}
});
export default router;

